func TestXAIProvider_SkipsIfAlreadyExists(t *testing.T) {
	t.Parallel()
	provider := XAIProvider(nil)
	require.NotEmpty(t, provider.ID)

	xaiInList := []catwalk.Provider{provider}
	result := XAIProvider(xaiInList)
	require.Empty(t, result.ID)
}

