func TestXAIProvider_DefaultAPIEndpoint(t *testing.T) {
	t.Setenv("XAI_API_ENDPOINT", "")

	provider := XAIProvider(nil)
	require.Equal(t, "https://api.x.ai/v1", provider.APIEndpoint)
}

